import React, { Component } from 'react'

export class ShowDesc extends Component {
  render() {
    return (
      <div className='full-item' onClick={() => this.props.onShowItem(this.props.item)}>
        <div>{this.props.item.desc}</div>
      </div>
    )
  }
}

export default ShowDesc
